import React, { useState, useEffect } from 'react';
import './Form.scss';

export default function Form({ fields, url }) {
    const [formState, setFormState] = useState(fields);

    const onSubmit = (e) => {
        e.preventDefault();
    };

    return (
        <form onSubmit={onSubmit} className='form'>
            <fieldset>
                <legend></legend>
                {formState.map((field) => (
                    <div>{field.desc}</div>
                ))}
            </fieldset>
        </form>
    );
}
